def add_drawing(username, password, film, image, views = 0, likes = 0):
    d = Drawing.objects.get_or_create(film=film, image=image)[0]
    d.user = User.objects.create_user(username=username, password=password)
    d.views = views
    d.likes = likes
    d.save()
    return d


